import React from 'react'
import CandidateBar from '../CandidateBar/CandidateBar'

const VotingPage = (props) => {
  return (
    <div>
      <h1
        style={{
          width: '100%',
          textAlign: 'center',
          fontSize: '52px',
          margin: '20px auto',
        }}
      >
        Ongoing Election Candidates
      </h1>
      <CandidateBar image="Image1" candidate="Candidate1"/>
    </div>
  )
}

export default VotingPage
